    "title": "Interstate 10 in California - Wikipedia",
    "content": "Jump to content Route map: From Wikipedia, the free encyclopedia Interstate Highway in California \"Christopher Columbus Transcontinental Highway\" redirects here. For the similarly named highway in New Jersey, see Interstate 80 in New Jersey. This article is about the section of Interstate 10 in California. For the entire route, see Interstate 10. Interstate 10 Pearl Harbor Memorial Highway I-10 highlighted in red Route information Maintained by Caltrans Length 242.54 mi[1] (390.33 km) Existed August 7, 1947, by FHWA[2] July 1, 1964, by Caltrans[3]โpresent NHS Entire route Major junctions West end SR 1 in Santa Monica Major intersections I-405 in Los Angeles I-110 / SR 110 in Los Angeles I-5 / US 101 / SR 60 in Los Angeles I-710 in Monterey Park I-605 in Baldwin Park I-15 in Ontario I-215 in Colton SR 210 in Redlands SR 60 in Beaumont US 95 in Blythe East end I-10 / US 95 at Arizona state line in Ehrenberg, AZ Location Country United States State California Counties Los Angeles, San Bernardino, Riverside Highway system Interstate Highway System Main Auxiliary Suffixed Business Future State highways in California Interstate US State Scenic History Preโ1964 Unconstructed Deleted Freeways โ SR 9 โ SR 11 Interstate 10 (I-10) is a transcontinental Interstate Highway in the United States, stretching from Santa Monica, California, to Jacksonville, Florida. The segment of I-10 in California, also known as the Pearl Harbor Memorial Highway,[4] runs east from Santa Monica through Los Angeles, San Bernardino, and Palm Springs before crossing into the state of Arizona. In the Greater Los Angeles area, it is known as the Santa Monica and San Bernardino freeways, linked by a short concurrency on I-5 (Golden State Freeway) at the East Los Angeles Interchange. I-10 also has parts designated as the Rosa Parks and Sonny Bono Memorial freeways.[5] Some parts were also formerly designated as the Christopher Columbus Transcontinental Highway.[6] However, the California State Legislature removed this designation following the passage of a bill on August 31, 2022.[7][8] I-10 is also known colloquially as \"the 10\" to Southern California residents (See also California English ยง Freeways). Route description [edit] Time-lapse video of a trip on I-10 from Baldwin Park to its western terminus in Santa Monica I-10 is signed as if it begins at the McClure Tunnel in Santa Monica, although it legally begins farther east at the SR 1 interchange at Lincoln Boulevard. A typical traffic jam on the Santa Monica Freeway, at 2:30 pm on a Wednesday afternoon near Robertson Boulevard Downtown Los Angeles skyline as seen from the freeway. A slight (smaller than usual rush hour) traffic jam is ahead. The Dosan Ahn Chang Ho Memorial Interchange (I-110), as seen by traffic going westbound on the Santa Monica Heavily defaced button copy sign marking an entrance to the Santa Monica Freeway in Downtown Los Angeles, 2005 Interchange with the Ontario Freeway (I-15) as seen by westbound traffic on the San Bernardino Freeway Heavy traffic from Downtown San Bernardino along the San Bernardino Freeway near the interchange with I-215 Cabazon Dinosaurs is a roadside attraction at the Main Street exit in Cabazon I-10 eastbound in Whitewater at the exit for SR 111, looking east with the San Gorgonio Pass wind farm in the background. Note the overhead sign which gives \"Indio [ยถ] Other Desert Cities\" as the control cities. I-10 eastbound near Indio The entirety of Interstate 10 in California is defined in section 310 of the California Streets and Highways Code as Route 10, and that the highway is from:[9] (a) Route 1 [State Route 1 (SR 1)] in Santa Monica to Route 5 [I-5] near Seventh Street in Los Angeles. (b) Route 101 [US Route 101 (US 101)] near Mission Road in Los Angeles to the Arizona state line at the Colorado River via the vicinity of Monterey Park, Pomona, Colton, Indio, and Chiriaco Summit and via Blythe. Because I-10 west of I-5 cannot access US 101, and I-10 east of I-5 cannot access US 101 southbound, signage instead directs motorists to the continuation of I-10 via I-5 between the East Los Angeles Interchange and the Santa Monica Freeway. The Federal Highway Administration (FHWA)\u0027s Interstate Highway route logs, along with most maps, also indicate that I-10 is cosigned along this segment,[1] despite the legal definition. The short unsigned section of Route 10 between Route 5 and Route 101, which was formerly defined as Route 110 (signed as I-110) until 1968, carries overhead signage for I-10 eastbound and for US 101 westbound. I-10 is part of the California Freeway and Expressway System[10] and is part of the National Highway System,[11] a network of highways that are considered essential to the country\u0027s economy, defense, and mobility by the FHWA.[12] I-10 is eligible to be included in the State Scenic Highway System,[13] but it is not officially designated as a scenic highway by Caltrans.[14] The Santa Monica Freeway is I-10 from SR 1 to I-5, as named",
