    "content": "Jump to content Coordinates: 27ยฐ58โฒ04โณS 153ยฐ24โฒ49โณE๏ปฟ / ๏ปฟ27.9678ยฐS 153.4136ยฐE๏ปฟ / -27.9678; 153.4136๏ปฟ (Southport (town centre)) From Wikipedia, the free encyclopedia This article is about the Australian suburb of Southport. For other uses, see Southport (disambiguation). Map all coordinates using OpenStreetMap Download coordinates as KML Suburb of Gold Coast, Queensland, Australia Suburb in Queensland, Australia Southport Suburb The Gold Coast Broadwater commercial district c. 2008 Southport Interactive map of Southport Coordinates: 27ยฐ58โฒ04โณS 153ยฐ24โฒ49โณE๏ปฟ / ๏ปฟ27.9678ยฐS 153.4136ยฐE๏ปฟ / -27.9678; 153.4136๏ปฟ (Southport (town centre)) Country Australia State Queensland City Gold Coast LGA City of Gold Coast Location 4.2 km (2.6 mi) N of Surfers Paradise 73.2 km (45.5 mi) SSE of Brisbane 36 km (22 mi) N of Tweed Heads Established 1874[1] Government โข State electorates Southport Bonney โข Federal division Moncrieff Area โข Total 15.6 km2 (6.0 sq mi) Elevation 9 m (30 ft) Population โข Total 36,786 (2021 census)[3] โข Density 2,358/km2 (6,107/sq mi) Time zone UTC+10:00 (AEST) Postcode 4215 Suburbs around Southport Arundel Parkwood Labrador Main Beach Molendinar Southport Main Beach Ashmore Bundall Surfers Paradise Southport is the most populous suburb in the City of Gold Coast in Queensland, Australia.[4][5] It contains the Gold Coast central business district. In the 2021 census, Southport had a population of 36,786 people.[3] Geography [edit] Southport is bounded to the south-east by the Nerang River ( 27ยฐ58โฒ32โณS 153ยฐ25โฒ21โณE๏ปฟ / ๏ปฟ27.9756ยฐS 153.4225ยฐE๏ปฟ / -27.9756; 153.4225๏ปฟ (Nerang River (mouth))),[6] where it flows into The Broadwater, the southernmost end of Moreton Bay, which then bounds the suburb to the north-east.[7] King Reach is a reach ( 27ยฐ59โฒ06โณS 153ยฐ25โฒ03โณE๏ปฟ / ๏ปฟ27.985ยฐS 153.4175ยฐE๏ปฟ / -27.985; 153.4175๏ปฟ (King Reach)) of the Nerang River. It was named in honour of Jeremy King (3 March 1935 โ 13 October 2010) for his coaching, involvement and dedication to the sport of rowing within the Southport district. He was involved with rowing for over 50 years. It was gazetted on 28 November 2014.[8] Ray Newlyn Channel is a channel ( 27ยฐ57โฒ20โณS 153ยฐ25โฒ04โณE๏ปฟ / ๏ปฟ27.9555ยฐS 153.4177ยฐE๏ปฟ / -27.9555; 153.4177๏ปฟ (Ray Newlyn Channel)) in The Broadwater. It is an east-to-west channel across The Broadwater to Main Beach avoiding two large sandbanks. Raymond Paul (Ray) Newlyn was a Southport resident and a Commander in the Australian Volunteer Coast Guard Association; he died on 18 October 1997, it was gazetted on 11 January 2002.[9][7][10][11] Musgrave Hill is a neighbourhood ( 27ยฐ57โฒ38โณS 153ยฐ23โฒ59โณE๏ปฟ / ๏ปฟ27.9605ยฐS 153.3997ยฐE๏ปฟ / -27.9605; 153.3997๏ปฟ (Musgrave Hill)) in western Southport. It was gazetted on 13 November 1982.[12] History [edit] Originally known as Nerang Creek Heads,[13] it was named Southport because it was the southernmost port of the colony of Queensland.[1] A settlement was first surveyed in 1874 and the name Southport decided the following year.[1] Southport was once the site of timber mills. A port was established to ship logs to Brisbane. Cutting timber opened up the area for settlement. Early rural industries included sugar growing and livestock grazing. Southport Provisional School opened on 17 February 1880. On 1 July 1882, it became Southport State School.[14] Congregational Church, 1910 In 1879, the first Congregational services were held in Southport in the home of J. C. Lather conducted by the Reverend J. Whiting who ministered in the Logan and Albert River districts. Land was purchased in Queen Street and a Congregational church was opened there on 9 October 1880.[15] It was used for monthly Congregational services but was also available for use by other denominations. The first minister, Reverend A.R. Bailey was appointed in 1883. A manse was built in Bauer Street. J.B. Evans was the minister from late 1885, being replaced by J. G. Cribb in 1887. In 1888 a new Congregational Church was erected in White Street costing ยฃ530 and based on the designs prepared for the Milton Congregational Church in Brisbane. In 1899, the manse was relocated to behind the White Street church.[16] Kiosk and jetty at Southport in the early 1900s, the gates of the Star of the Star Convent are in the foreground. In 1883, the first Southport Pier was built to allow steamships to bring cargo and passengers to Southport.[17][18] In the 1880s, Southport became the chosen site for the holiday residence of the Queensland Governor Sir Anthony Musgrave and his wife Lady Musgrave. Known as the Summer Place and still situated on the present day site of The Southport School, the choice of Southport as the preferred holiday destination for one of the most prominent couples in Queensland established the township as Queensland\u0027s pre-eminent seaside resort.[19] Following the death of the governor in 1888, the Summer Place continued to be a holiday home for visitors to the area.[20][21] St Peters Church of England, 1900-1909 On Sunday 12 June 1887",
