    "content": "Jump to content From Wikipedia, the free encyclopedia American football player (1942โ2025) For his son, see George Mira Jr. George Mira George Mira c. 1962 No. 10 Position Quarterback Personal information Born (1942-01-11)January 11, 1942 Key West, Florida, U.S. Died December 9, 2025(2025-12-09) (aged 83) Miami, Florida, U.S. Height 6 ft 0 in (1.83 m) Weight 190 lb (86 kg) Career information High school Key West College Miami (FL) (1960โ1963) NFL draft 1964: 2nd round, 15th overall pick AFL draft 1964: 18th round, 137th overall pick Career history San Francisco 49ers (1964โ1968) Philadelphia Eagles (1969) Baltimore Colts (1970)* Miami Dolphins (1971) Montreal Alouettes (1972โ1973) Birmingham Americans (1974) Jacksonville Express (1975) Toronto Argonauts (1977) * Offseason and/or practice squad member only Awards and highlights First-team All-American (1962) Second-team All-American (1963) Miami Hurricanes No. 10 retired Career NFL statistics Passing attempts 346 Passing completions 148 Completion percentage 42.8% TDโINT 19โ20 Passing yards 2,110 Passer rating 57.4 Rushing yards 379 Stats at Pro Football Reference Career CFL statistics Passing attempts 327 Passing completions 157 Completion percentage 48% TDโINT 19โ23 Passing yards 2,291 George Ignacio Mira (January 11, 1942 โ December 9, 2025) was an American professional football player who was a quarterback for eight seasons in the National Football League (NFL) with four teams. He then played five seasons in the Canadian Football League (CFL) and the World Football League (WFL). He played college football for the Miami Hurricanes. Early life [edit] George Ignacio Mira was born in Key West, Florida, on January 11, 1942.[1] He was born to Jimmy Mira Sr. and Delores Mira.[2] Mira\u0027s father was a foreman at an ice supplier while his mother was a stay-at-home mom. Mira attended Key West High School, where he played basketball, baseball, and football. A pitcher in baseball, Mira led his high school teams to two state championships in 1958 and 1959.[3] He graduated from high school in 1960.[4] College career [edit] After high school, Mira joined the University of Miami to play college football under head coach Andy Gustafson in 1960.[5] He had received an offer of $20,000[a] to sign with the Baltimore Orioles of Major League Baseball, but turned it down to finish college instead.[7] He was an immediate starter his freshman season, and set records for the University of Miami during his sophomore year.[8] Mira, nicknamed \"the Matador,\"[9] was well known for the \"fastball\" he would throw to receivers, influenced by his baseball prowess.[8][10] He was also known as a \"scrambler,\" frequently running on the field.[11] Bill Peterson of the Florida State Seminoles once said of Mira: \"He can throw, fake, and run. He keeps the pressure on you and he\u0027s the best I\u0027ve ever seen.\"[12] One of the best games in Mira\u0027s collegiate career came as a junior in 1962 in the Gotham Bowl against the Nebraska Cornhuskers. Despite playing in 20 ยฐF (โ7 ยฐC) weather in front of fewer than a thousand fans at Yankee Stadium, Mira threw for 321 yards, a Miami school record at the time, and was named the bowl game\u0027s most valuable player. Despite Mira\u0027s efforts, the Cornhuskers won by two points, 36โ34.[13][14] The previous year, the Hurricanes lost by a single point to Syracuse in the Liberty Bowl,[15] in a game where Mira was reportedly recovering from a viral infection.[16] George Mira in a car in front of Key West City Hall with a sign that reads \u0027The Matador of Key West\u0027 in 1962. Mira was a sensation in Key West while he played for Miami. At one point, the city hosted a \"George Mira Day\" where they temporarily named a street in his honor.[2] At the start of the 1963 season Mira was the cover story for the college preview issue of Sports Illustrated. The article, written by Key West native John Underwood, was titled \"One Wonderful Conch is this Mira\" and featured many anecdotes about Mira\u0027s life growing up and becoming a star on the small island.[2][17] Professional career [edit] Mira was selected in the second round of the 1964 NFL draft, fifteenth overall, by the San Francisco 49ers. Primarily a reserve,[18] he played for eight NFL seasons, 1964 through 1971, for the 49ers, Philadelphia Eagles, Baltimore Colts, and Miami Dolphins. He was a backup to John Brodie in San Francisco and to Bob Griese in Super Bowl VI as a member of the 1971 Dolphins.[19] With the 49ers in 1964, he threw a pass to quarterback Billy Kilmer (who was playing running back) that Kilmer eventually fumbled; the fumble would be recovered by Minnesota Vikings defensive end Jim Marshall, who infamously ran 66 yards in the wrong direction.[20] Mira signed a multi-year contract with the Montreal Alouettes of the Canadian Football League (CFL) in August 1972,[21][22] completing 92 of 168 passes for 1356 yards and 11 touchdowns and eight interceptions in 1973.[23] With the Birmingham Americans of the new World Football League ",
