    "title": "Linux - Wikipedia",
    "content": "Jump to content Checked From Wikipedia, the free encyclopedia This is the latest accepted revision, reviewed on 13 December 2025. Family of Unix-like operating systems This article is about the family of operating systems. For the kernel, see Linux kernel. For other uses, see Linux (disambiguation). Operating system Linux Tux the penguin, the mascot of Linux[1] Developer Community contributors, Linus Torvalds Written in C, assembly language OS family Unix-like Working state Current Source model Open-source Initial release September 17, 1991; 34 years ago (1991-09-17)[2] Repository git.kernel.org/pub/scm/linux/kernel/git/torvalds/linux.git/ Marketing target Cloud computing, embedded devices, mainframe computers, mobile devices, personal computers, servers, supercomputers Available in Multilingual Supported platforms Alpha, ARC, ARM, C-Sky, Hexagon, LoongArch, m68k, Microblaze, MIPS, Nios II, OpenRISC, PA-RISC, PowerPC, RISC-V, s390, SuperH, SPARC, x86, Xtensa Kernel type Monolithic Userland util-linux by standard,[a] various alternatives, such as Busybox,[b] GNU,[c] Plan 9 from User Space[d] and Toybox[e] Influenced by Minix, Unix Default user interface Most distributions include a desktop environment (GUI). License GPLv2 (Linux kernel)[14][f] Official website kernel.org Articles in the series Linux kernel Linux distribution Linux (/หlษชnสks/ LIN-uuks)[16] is a family of open source Unix-like operating systems based on the Linux kernel,[17] an operating system kernel first released on September 17, 1991, by Linus Torvalds.[18][19][20] Linux is typically packaged as a Linux distribution (distro), which includes the kernel and supporting system software and librariesโmost of which are provided by third partiesโto create a complete operating system, designed as a clone of Unix and released under the copyleft GPL license.[21] Thousands of Linux distributions exist, many based directly or indirectly on other distributions;[22][23] popular Linux distributions[24][25][26] include Debian, Fedora Linux, Linux Mint, Arch Linux, and Ubuntu, while commercial distributions include Red Hat Enterprise Linux, SUSE Linux Enterprise, and ChromeOS. Linux distributions are frequently used in server platforms.[27][28] Many Linux distributions use the word \"Linux\" in their name, but the Free Software Foundation uses and recommends the name \"GNU/Linux\" to emphasize the use and importance of GNU software in many distributions, causing some controversy.[29][30] Other than the Linux kernel, key components that make up a distribution may include a display server (windowing system), a package manager, a bootloader and a Unix shell. Linux is one of the most prominent examples of free and open-source software collaboration. While originally developed for x86 based personal computers, it has since been ported to more platforms than any other operating system,[31] and is used on a wide variety of devices including PCs, workstations, mainframes and embedded systems. Linux is the predominant operating system for servers and is also used on all of the world\u0027s 500 fastest supercomputers.[g] When combined with Android, which is Linux-based and designed for smartphones, they have the largest installed base of all general-purpose operating systems. Overview [edit] The Linux kernel was designed by Linus Torvalds, following the lack of a working kernel for GNU, a Unix-compatible operating system made entirely of free software that had been undergoing development since 1983 by Richard Stallman. A working Unix system called Minix was later released but its license was not entirely free at the time[32] and it was made for an educative purpose. The first entirely free Unix for personal computers, 386BSD, did not appear until 1992, by which time Torvalds had already built and publicly released the first version of the Linux kernel on the Internet.[33] Like GNU and 386BSD, Linux did not have any Unix code, being a fresh reimplementation, and therefore avoided the legal issues.[34] Linux distributions became popular in the 1990s and effectively made Unix technologies accessible to home users on personal computers whereas previously it had been confined to sophisticated workstations.[35] Desktop Linux distributions include a windowing system such as X11 or Wayland and a desktop environment such as GNOME, KDE Plasma or Xfce. Distributions intended for servers may not have a graphical user interface at all or include a solution stack such as LAMP. The source code of Linux may be used, modified, and distributed commercially or non-commercially by anyone under the terms of its respective licenses, such as the GNU General Public License (GPL). The license means creating novel distributions is permitted by anyone[36] and is easier than it would be for an operating system such as macOS or Microsoft Windows.[37][38][39] The Linux kernel, for example, is licensed under the GPLv2, with an exception for system calls that allows code that calls the kernel via system ca",
